    "whatsnew_20200525": "<0>Version 2020-05-25</0><1>Verbesserungen der Benutzeroberflche</1><2><0>SafeWay- und Sternkraft-Logo-Wasserzeichen fr jedes heruntergeladene Bild.</0><1>Roaming-Status des Trailers wird angezeigt.</1><2>Videos und Bilder fr Ereignisse (+ 1 Minute, 0 und -1 Minute) werden automatisch heruntergeladen. </2><3>Der verbleibende Datenverkehr wird angezeigt (lokal und Roaming getrennt). </3> <4> Flexibles Vorbild. </4> <5> Toolbox fr die Verwaltung von Sensorwarnungen (Aktivierung / Deaktivierung pro Sensor). </5> <6> Ausgehende SMS- und E-Mail-Benachrichtigungen. </6> <7> GPS-Signalverlust hervorgehoben. </7> <8> Kartenereignisse mit GPS-Verlust werden angezeigt. </8> <9> Verbesserungen beim Design des Header-Panels. </9> </2> <3> Technische Verbesserungen </3> <4> <0> Automatisches Herunterladen von Bildern im Heimnetzwerk jede Minute. </0> <1> Heruntergeladene Bilder knnen auch dann angezeigt werden, wenn der Trailer offline ist. </1> <2> Der Roaming-Status wird erkannt, in der Datenbank aufgezeichnet und in angezeigt die Schnittstelle. </2> </4>",
    "whatsnew_20200412": "<0>Version 2020-04-12</0><1>Verbesserungen der Benutzeroberflche</1><2><0>Funktion \"Video lokal speichern\"</0><1> Vermeiden Sie bermiges erneutes Rendern des berwachungsfensters.</1><2> Das Kamerabild wird jede Minute in der Cloud aufgezeichnet.</2><3> Miniaturbilder werden automatisch in der Timeline angezeigt.</3><4> Das Diagramm \"Datenbertragung\" zeigt den lokalen Verkehr und wird tglich aktualisiert.</4><5> Das Diagramm \"EU-Datenbertragung\" zeigt den Roaming-Verkehr.</5><6> Klicken Sie auf Ereignis- oder Routenmarkierung auf der Karte, um das berwachungsfenster zu ffnen.</6><7> Das berwachungsfenster zeigt den Status \"Aktiviert / Deaktiviert\" der Kamera an.</7><8> Mediendateien sind fr eine komfortable Sortierung benannt.</8><9> Informationen zur Signalstrke werden im Bedienfeld angezeigt.</9><10> Geteilte Motor-Ein / Aus- und Parkereignisse.</10></2><3>Technische Verbesserungen</3><4><1> Verbesserungen der Videoansicht und der Downloadstabilitt </1><2> Verbesserungen der GPS-Filterung zum Entfernen von Fehlerabweichungen </2><3> Verbesserungen der Gerteereignisprotokollierung </3><4> Kontinuierliche berwachung der Gertetemperatur (GPU und CPU) </4><5> Verbindungsstabilitt auf Unternehmensebene zwischen Gert und Server</5><6>Erkennung von Video-Download-Problemen, Informationen dazu </6></4>",
    "whatsnew_20200221": "<0>Version 2020-02-21</0><1>Verbesserungen der Benutzeroberflche</1><2><0>Der Trailer OFFLINE-Indikator wird um eine informative Meldung erweitert.</0><1>Die Karte enthlt Markierungen mit Zeit und Geschwindigkeit eines Trailers - wird angezeigt, wenn Sie den Mauszeiger ber</1>halten<2>Wenn kein Bild oder Video von der Kamera verfgbar ist, wird das Augensymbol mit einer Meldung rot.</2><3>Parkereignisse werden auf der Karte angezeigt (Parksymbol).</3><4><0>Trailer ist \"geparkt\", wenn der Motor ausgeschaltet ist.</0></4><5>Motor-EIN / AUS-Ereignisse sind im Ereignisbereich, im Ereignisdetailbereich und in der Karte verfgbar.</5><6>Batteriestandsanzeige wird anhand der physischen Entladungskurve berechnet.</6><7>Der 14-Tage-Aufzeichnungsverlauf wird zur Verfgung gestellt.</7><8>Der Trailer wird regelmig wieder verbunden, wenn die Netzabdeckung verloren geht.</8></2><3>Technisch Verbesserungen</3><4><0>Ungltige GPS-Punkte vom Gert werden gefiltert, um Routenstrungen zu vermeiden.</0><1>Eine regelmige Wiederverbindung wird implementiert, wenn der Trailer vorbergehend das Netzwerk verlsst.</1><2>DB-Suchen werden optimiert, Bereinigungsverfahren implementiert.</2></4>",
    "whatsnew_20200202": "<0>Version 2020-02-02</0><1>Verbesserungen der Benutzeroberflche </1> <2> <0> Bereich \"Was ist neu\", in dem alle Updates und Fixes seit der letzten Version </0> <1> Jetzt beim letzten Mal angezeigt werden Auf dem Panel wird ein Update vom Trailer angezeigt (\"Last login\"). </1> <2> Anzeige Trailer Engine ON / OFF im Navigationsbereich und im Detailbereich. </2> <3> Anzeige Trailer ONLINE / OFFLINE im Navigationsbereich und im Detailbereich. </3> <4> <0> Trailer ist \"online\", wenn die Statusaktualisierung in den letzten 30 Sekunden erfolgt ist. </0> </4> <5> Neue Trailer-Events sind verfgbar fr Ereignisfenster, Ereignisdetailfenster und Karte: <1> <0> LKW von Anhnger getrennt / mit Anhnger verbunden </0> <1> LKW-Batterie schwach / in Ordnung </1> <2> Systemabschaltung nhert sich (5 min Herunterfahren) </2> <3> System wird gerade heruntergefahren </3> </1> </5> <6> Die GPS-Route ist viel flssiger und fehlerfrei: <1> <0> GPS-Punkte sind alle 2 Sekunden aufgezeichnet </0> <1> GPS-Punkte werden alle 30 Sekunden an den Server gesendet </1> <2> Wenn der Trailer offline geschaltet wird, werden die GPS-Punkte auf dem Gert gestapelt und gesendet, wenn das Netzwerk eine Verbindung herstellt</2> </1> </6> <7> Behobene Bildschirmstrungen (Anmeldebildschirm-Fehlermeldung, Sprachressourcen) </7> <8> Fr alle Kameras optimierte h.264-Parameter </8> <9> Alle Kameras sind fr die Verwendung der GPS-Zeit zum Synchronisieren der internen Uhr eingerichtet. </9> </2> <3> Technische Verbesserungen </3> <4> <0> Die Leistung des Web Panels wird in der Produktion optimiert. </0> <1> Alle Code-Probleme mit RSpec wurden behoben, Tests wurden ohne Warnungen ausgefhrt. </1> <2> Die DB-Struktur und die Backend-Leistung wurden optimiert </2> </4>",
