    "whatsnew_20200525": "<0>Wersja 2020-05-25</0><1>Poprawki interfejsu uytkownika</1><2><0>Znaki wodne logo SafeWay i Sternkraft kadego pobranego obrazu.</0><1>Stan roamingu przyczepy jest wywietlany.</1><2>Wideo i obrazy z wydarze (+ 1 min, 0 i -1 min) s pobierane automatycznie.</2><3>Pozostay ruch jest wywietlany (lokalnie i roaming oddzielnie).</3><4>Elastyczny model do naladowania.</4><5>Zestaw narzdzi do zarzdzania alertami czujnikw (aktywacja / dezaktywacja na czujnik).</5><6>Powiadomienia wychodzce SMS-y i e-mail.</6><7>Utrata sygnau GPS zaznaczone.</7><8>Wywietlane s zdarzenia utraty GPS na mapie.</8><9>Ulepszenia projektu panelu nagwka.</9></2><3>Poprawki techniczne</3><4><0>Automatyczne pobieranie obrazw w sieci domowej co minut.</0><1>Pobrane obrazy s dostpne do przegldania, nawet gdy przyczepa jest w trybie offline.</1><2>Stan roamingu jest wykrywany, zapisywany w bazie danych i wywietlany w interfejs.</2></4>",
    "whatsnew_20200412": "<0>Wersja 2020-04-12</0><1>Poprawki interfejsu uytkownika</1><2><0>Funkcja \"Zapisz wideo lokalnie\",</0><1>Wyeliminuj nadmierne ponowne renderowanie okna monitorowania</1><2>Obraz z kamery jest zapisywany w chmurze co minut</2><3>Obrazy miniatur s automatycznie wywietlane na osi czasu</3><4>Tabela \"Transfer danych\ pokazuje ruch lokalny, aktualizuje codziennie</4><5>Wykres \"Przesyanie danych w UE\ pokazuje ruch w roamingu</5><6>Kliknij znacznik zdarzenia lub trasy na mapie, otwiera okno Monitorowania</6><7>Okno monitorowania wywietla stan wczenia / wyczenia kamery</7><8>Pliki multimedialne zostay nazwane w celu wygodnego sortowania</8><9>Informacje o sile sygnau s wywietlane w panelu</9><10>Podzielone wczenie / wyczenie silnika i zdarzenia parkowania</10></2><3>Poprawki techniczne</3><4><1> Ulepszenia widoku wideo i stabilnoci pobierania </1><2> Ulepszenia filtrowania GPS w celu usunicia odchyle bdw </2><3> Ulepszenia rejestrowania zdarze urzdzenia </3><4> Cige monitorowanie temperatury urzdzenia (GPU i procesora) </4><5> Stabilno poczenia na poziomie przedsibiorstwa midzy urzdzeniem a serwerem </5><6> Wykrywanie problemw z pobieraniem wideo, informacje na ich temat </6></4>",
    "whatsnew_20200221": "<0>Wersja 2020-02-21</0><1>Poprawki interfejsu uytkownika</1><2><0>Wskanik OFFLINE zosta wzbogacony o wiadomo informacyjn</0><1>Po najechaniu na tras, pojawia si informacja o czasie i prdkoci naczepy</1><2>Kiedy kamera jest niedostpna, ikona zmienia kolor na czerwony, oraz pojawia si informacja.</2><3>Dodano wydarzenie \"Parking\" na mapie</3><4><0>Wydarzenie parking ma miejsce kiedy silnik cignika jest wyczony</0></4><5>Wydarzenie \"Wyczenie/Wczenie silnika\" jest widoczne w panelu wydarzenia oraz na mapie</5><6>Wskanik naadowania akumulatora dziaa teraz bardziej precyzyjnie</6><7>Nagrania dostpne s teraz do 14 dni wstecz</7><8>Poczenie z naczep jest teraz odnawiane automatycznie w przypadku problemw z pobieraniem nagra</8></2><3>Poprawki techniczne</3><4><0>Nieprawidowe wskazania GPS s teraz filtrowane przez urzdzenie</0><1>Cykliczne odnawiania poczenia w celu zapewnienia stabilnego dziaania</1><2>Wyszukiwanie w bazie danych zostao zoptymalizowane. Przeprowadzono procedury czyszczenia bazy danych</2></4>",
